import React from 'react'
import { observer } from "mobx-react-lite";
import '../index.css'

const SquareView = observer(({ node, grid, drawingMode, gridFunction, mouseEvents }) => (
    <div 
        id={'node-' + node.col + '-' + node.row} 
        className={'node' + node.nodeId}
        onClick={() => {mouseEvents.mouseClick(node, grid)}}
        onMouseDown={() => {mouseEvents.mouseDown(node, grid.drawingMode, gridFunction)}}
        onMouseUp={() => {mouseEvents.mouseUp()}}
        onMouseOver={() => {mouseEvents.mouseOver(node, grid.drawingMode, gridFunction)}}>
    </div>
))

export default SquareView
